import React from 'react'
import { FormGroup,FromControl,ControlLabel,Button} from 'react-bootstrat'

export default class Form extends React.Component{
    constructor(props){
        super(props);
        this.state= {
            age: undefined,
            gender: undefined,
            other : undefined,
        }
    }

    render() {
        return(
            <div>
                <Form inline>
                    <FormGroup controlId='formInLineAge'>
                        <ControlLabel>Age</ControlLabel>{'  '}
                        <FormControl type='number' placeholder='23'/>
                    </FormGroup>{'  '}
                    <FormGroup controlId='formInLineGender'>
                        <ControlLabel>Gender</ControlLabel>{'   '}
                        <FormControl componentClass='select' placeholder="select">
                            <option value="male">male</option>
                            <option value="female">female</option>
                            <option value="other">other</option>
                        </FormControl>
                    </FormGroup>
                </Form>
                <form>
                    <FormGroup controlId='formOther'>
                        <ControlLabel> Example for other stuff</ControlLabel>
                        <FormControl 
                                type='text'
                            //  onChange={func}
                        />
                    </FormGroup>
                </form>
            </div>
        )
    }

}
